// @mui material components

import SuiTypography from "components/SuiTypography";
// import { Link } from 'react-router-dom';
// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";

import { Table } from 'react-bootstrap';



function Cams() {
    return (
        <DashboardLayout>
            <DashboardNavbar />

            <br />

            <SuiTypography variant="h2" fontWeight="medium" style={{ textAlign: 'center', color: 'green' }}>

                My CAMS FUNDSNET CREDS

            </SuiTypography>

            <br />
            <hr style={{ color: 'red' }} />
            

            <br />
            <Table striped bordered hover size="sm" style={{ textAlign: "center" }}>

                <thead>

                    <tr>

                        <th style={{ padding: '15px', backgroundColor: "#038d8a" }}>Name</th>

                        <th style={{  padding: '15px', backgroundColor: "#038d8a" }}>CAMS Fundsnet ID</th>


                        <th style={{  padding: '15px', backgroundColor: "#038d8a" }}>CAMS Fundsnet Password</th>

                        <th style={{  padding: '15px', backgroundColor: "#038d8a" }}>CAMS Secret Qn Answer</th>

                        <th style={{   padding: '15px',backgroundColor: "#038d8a" }}>Action</th>

                    </tr>

                </thead>
                <tbody>

                    <tr>

                        <td style={{ padding: "10px" }}>Anuraag Saboo</td>
                        <td>ARGS</td>

                        <td>Cams@1234567</td>

                        <td>1</td>

                        {/* <td>
                            <Link to={""} >Edit</Link>
                        </td> */}

                    </tr>
                </tbody>
            </Table>

            <Footer />
        </DashboardLayout>
    );
}

export default Cams;
